import React from 'react';
import logo from '../logo.svg';

function Header(props) {

  authenticate = async() => {
    console.log("hello");
  }

  return(
    <div>
      <img src={logo} className="logo" alt="logo" />
      <h1>DUBZOO</h1>
      <button onClick={authenticate}>LOGIN</button>
    </div>
  );
}

export default Header;
